import React from "react";
import { Outlet } from "react-router-dom";
import NavLink from "../components/NavLink"; // If this is a custom NavLink component

export default function Nav() {
  return (
    <div>
      {/* Navigation Bar */}
      <nav className="relative w-full max-w-screen-lg mx-auto h-12 my-3 flex justify-center items-center">
        
        {/* Nav Logo */}
        <div className="absolute left-4 top-0 flex items-center h-full">
          {/* Place your logo here */}
          <img src="/path/to/logo.png" alt="Logo" className="h-full" />
        </div>

        {/* Menu Links */}
        <div className="flex justify-center space-x-4">
          <NavLink to="/" label="Home" />
          <NavLink to="/about" label="About" />
          <NavLink to="/service" label="Services" />
          <NavLink to="/team" label="Team" />
        </div>
      </nav>

      {/* Outlet for Nested Routes */}
      <div className="container mx-auto p-4">
        <Outlet />
      </div>
    </div>
  );
}
